// src/features/posts/post.slice.js

import axios from 'axios';
import { createAsyncThunk } from '@reduxjs/toolkit';

const loadlevels = createAsyncThunk('levels/loadLevels', async (userId) => {
    try {
        const response = await axios.get('http://localhost:1337/levels');
        return response;
    } catch(error) {
        return error;
    }
});
